import axios from 'axios'

axios.defaults.withCredentials = true;

const API_URL = 'http://localhost:8000/'

class UserService {
    profile(){
        return axios
        .get(API_URL + 'profile/',)
        .then(response => {

            return response.data
        })


    }

    // fetch user history

}

export default new UserService();
